        avgpt=(sum * 1.0d) / timesDiff;
      }
    }
    statsSnapshot.setSum(sum);
    statsSnapshot.setTps(tps);
    statsSnapshot.setAvgpt(avgpt);
  }
  return statsSnapshot;
}
